      <text id="9" justification="0" size="4" underlined="false">
        <text>Un garage sotterraneo è formato da più piani ognuno con una lettera e un&apos;altezza massima. In ogni piano ci sono più
posti auto, ognuno con un numero identificativo e questi possono essere occupati o meno. Il costo orario è unico
per tutto il garage. Quando un&apos;auto arriva all&apos;ingresso, le viene presentato l&apos;elenco dei posti liberi per ciascun piano
in cui può entrare (per l&apos;altezza), quindi l&apos;autista sceglie il posto e viene registrata l&apos;ora di ingresso e fornito un
biglietto con l&apos;identificativo del posto. Per uscire, l&apos;automobilista fornisce il biglietto e il sistema gli indica l&apos;importo
da pagare e libera il posto che occupava.</text>
      </text>
